)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{"coordinates":null,"data_source":{"id":"1150"},"glyph":{"id":"1171"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1173"},"nonselection_glyph":{"id":"1172"},"view":{"id":"1175"}},"id":"1174","type":"GlyphRenderer"},{"attributes":{},"id":"1474","type":"AllLabels"},{"attributes":{"dimensions":"width"},"id":"1142","type":"PanTool"},{"attributes":{},"id":"1429","type":"BasicTickFormatter"},{"attributes":{"coordinates":null,"group":null},"id":"1415","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"1438"},"group":null,"major_label_policy":{"id":"1439"},"ticker":{"id":"1085"},"visible":false},"id":"1084","type":"LinearAxis"},{"attributes":{},"id":"1452","type":"AllLabels"},{"attributes":{"axis":{"id":"1166"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1168","type":"Grid"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1520","type":"MonthsTicker"},{"attributes":{},"id":"1441","type":"BasicTickFormatter"},{"attributes":{"coordinates":null,"data_source":{"id":"1038"},"glyph":{"id":"1067"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1069"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1071"}},"id":"1070","type":"GlyphRenderer"},{"attributes":{"tools":[{"id":"1234"},{"id":"1235"},{"id":"1236"}]},"id":"1237
